import React from "react";
import "../style/SearchPage.css";
import SearchBar from "./SearchBar.js";

export default function SearchPage({ searched }) {
    return (
        <div className="SearchPage">
            <SearchBar searched={searched} />
            <div className="SearchPageContainer">
                <div className="SearchPageContent">
                    <div className="SearchPageContentContainer">
                        <div className="SPCCTitle">Title</div>
                        <div className="SPCCHor">
                            <div className="SPCCImage"></div>
                            <div className="SPCCDescription">Firstly, React is frontend framework for JavaScript. React allows us to easily split code into units of abstraction called components. The real power behind components is that they can be composed of smaller components to create larger and more complex systems. React also brings to the table a powerful feature called reactivity (hence the name React). Reactivity allows for UI elements to reactively update to data state changes without the developer manually having to do the update. This by far is one of the most powerful features that most if not all modern JavaScript frameworks bring to the table and allows for us the developer to greatly reduce the potentially complicated and bug-prone boilerplate code needed for updating UI elements with new data.</div>
                        </div>
                        <div className ="SPCCReviews">5 Stars</div>
                    </div>
                </div>
            </div>
        </div>
    );
}
